webpackJsonp([478],{"./node_modules/json-loader/index.js!./.cache/json/articles-meta-free-code-camp-official-chat-rooms.json":function(e,a){e.exports={data:{markdownRemark:{html:'<h3>Note: if you came here because you saw a message that one of the chat rooms you\'re a member of is closing, please <a href="//forum.freecodecamp.com/t/simplifying-fccs-gitter-chatrooms/37621">go here</a>.</h3>\n<h1>The following are our official chat rooms.</h1>\n<p><strong>Please note that all chat rooms listed here are publicly accessible and indexed by search engines, so only share email addresses or other sensitive information in private messages.</strong></p>\n<p><a href="https://gitter.im/freecodecamp/FreeCodeCamp">FreeCodeCamp</a> our main chat room - hang out and chat about life and learning to code<br>\n<a href="https://gitter.im/freecodecamp/Help">Help</a> get help with our HTML, CSS and jQuery challenges from your fellow campers<br>\n<a href="https://gitter.im/freecodecamp/HelpJavaScript">HelpJavaScript</a> get help with our JavaScript and algorithm challenges from your fellow campers<br>\n<a href="https://gitter.im/freecodecamp/HelpFrontEnd">HelpFrontEnd</a> get help with our front end projects from your fellow campers<br>\n<a href="https://gitter.im/freecodecamp/HelpDataViz">HelpDataViz</a> get help with our data visualization projects from your fellow campers<br>\n<a href="https://gitter.im/freecodecamp/HelpBackEnd">HelpBackEnd</a> get help with our back end projects from your fellow campers<br>\n<a href="https://gitter.im/freecodecamp/CodeReview">CodeReview</a> give and receive constructive feedback from your fellow campers on your projects<br>\n<a href="https://gitter.im/freecodecamp/YouCanDoThis">YouCanDoThis</a> learning to code is hard - share your feelings and get moral support here<br>\n<a href="https://gitter.im/FreeCodeCamp/LetsPair">LetsPair</a> find other campers with whom you can pair program<br>\n<a href="https://gitter.im/FreeCodeCamp/CodingJobs">CodingJobs</a> chat about the process of getting a coding job, such as portfolios, networking, and interviewing<br>\n<a href="https://gitter.im/freecodecamp/Casual">Casual</a> you can chat about your non-coding interests with other campers here<br>\n<a href="https://gitter.im/freecodecamp/Contributors">Contributors</a> help us improve our open source curriculum<br>\n<a href="https://gitter.im/freecodecamp/DataScience">DataScience</a> help us understand our gigs and gigs of public data</p>',frontmatter:{title:"Free Code Camp Official Chat Rooms",parent:"/home/stuart/guides/src/pages/articles/meta/free-code-camp-official-chat-rooms/index.md absPath of file"}}},pathContext:{slug:"/articles/meta/free-code-camp-official-chat-rooms/"}}}});
